#!/usr/bin/env python3

def popular(s):
    unique_letters = list(set(s))
    dict_letters = {l : 0 for l in unique_letters}
    
    for l in unique_letters:
        dict_letters[l]=s.count(l)
        
    list_letters = [[num,l] for l,num in dict_letters.items()]
    list_letters.sort(reverse=True)

    unique_nums = list(set( [num for num,l in list_letters] ))
    unique_nums.sort(reverse=True)
    top_nums = unique_nums[0:3]
    
    top_ct=0
    candidate_ct=0
    while (top_ct<3):
        top_letters = [[l,num] for num,l in list_letters if num==top_nums[candidate_ct]]
        top_letters.sort()
        top_length = len(top_letters)
        if (top_ct+top_length<=3):
            for ii in range(top_length):
                print(f"{top_letters[ii][0]} {top_letters[ii][1]}")
            top_ct += top_length
            candidate_ct += 1
        else:
            for ii in range(3-top_ct):
                print(f"{top_letters[ii][0]} {top_letters[ii][1]}")
            top_ct=3

s = ""

popular(s)
